181.body:
Often, users introduce an expression Y, which is derived from another expression X (Y == F(X), for some F). Instead of defining Y directly, in terms of the properties it possesses, it is possible to define all the intermediate steps of transforming X into Y: "X is slightly changed into X1 (e.g. by adding one element to a set, or via EXCEPT), which is changed into X2, etc. until Xn = Y". Doing this in Apalache is almost always a bad idea, if a direct characterization of Y exists. Concretely, the following constructs are APs: Incremental EXCEPT G == LET F(g, x) == [g EXCEPT ![x] = A(x)] IN ApaFoldSet(F, f, S) Incremental \union R == LET F(T, e) == T \union {A(e)} IN ApaFoldSet(F, S0, S) Chained @@/:> f == ( k1 :> A(k1) ) @@ ( k2 :> A(k2) ) @@ ... @@ ( kn :> A(kn) ) For example: f == [ x \in 1..20 |-> 0 ]
Y == LET F(g, x) == [g EXCEPT ![x] = x * x] IN ApaFoldSet(F, f, 7..12 ) TLC likes these sorts of operations, because it manipulates programming-language objects in its own implementation. This makes it easy to construct temporary mutable objects, manipulate them (e.g. via for-loops) and garbage-collect them after they stop being useful. For constraint-based approaches, like Apalache, the story is different. Not only are these intermediate steps not directly useful (since Apalache is not modeling TLA+ expressions as objects in Scala), they actually hurt performance, since they can generate a significant amount of constraints, which are all about describing data structures (e.g. two functions being almost equal, except at one point). Essentially, Apalache is spending its resources not on state-space exploration, but on in-state value computation, which is not its strong suit. Below we show how to rewrite these APs. Incremental EXCEPT: Replace G == LET F(g, x) == [g EXCEPT ![x] = A(x)] IN ApaFoldSet(F, f, S) with G == [ x \in DOMAIN f |-> IF x \in S THEN A(x) ELSE f[x]
] Incremental \union: Replace R == LET F(T, e) == T \union {A(e)} IN ApaFoldSet(F, S0, S) with R == S0 \union { A(e): e \in S } Iterated @@/:>: Replace f == ( k1 :> A(k1) ) @@ ( k2 :> A(k2) ) @@ ... @@ ( kn :> A(kn) ) with f == [ k \in {k1,...,kn} |-> A(k) ]

