Notation: {e_1, ..., e_n} LaTeX notation: {e_1, ..., e_n} Arguments: Any number of arguments, n >= 0. Apalache type: (a, ..., a) => Set(a), for some type a. Effect: Produce the set that contains the values of the expressions e_1, ..., e_n, in no particular order, and only these values. If n = 0, the empty set is constructed. Determinism: Deterministic. Errors: Pure TLA+ does not restrict the set elements. They can be any combination of TLA+ values: Booleans, integers, strings, sets, functions, etc. TLC only allows a user to construct sets out of elements that are comparable. For instance, two integers are comparable, but an integer and a set are not comparable. See Section 14.7.2 of Specifying Systems . Apalache goes further and requires that all set elements have the same type. If this is not the case, the type checker flags an error. Example in TLA+: { 1, 2, 3 } \* a flat set of integers { { 1, 2 }, { 2, 3 } } \* a set of sets of integers { FALSE, 1 } \* a set of mixed elements. \* Model checking error in TLC, type error in Apalache Example in Python: >>> {1, 2, 3}
{1, 2, 3}
>>> {frozenset({2, 3}), frozenset({1, 2})}
{frozenset({2, 3}), frozenset({1, 2})}
>>> {False, 1}
{False, 1}

