Notation: e \in S LaTeX notation: in Arguments: Two arguments. If the second argument is not a set, the result is undefined. Apalache type: (a, Set(a)) => Bool, for some type a. Effect: This operator evaluates to: TRUE, if S is a set that contains an element that is equal to the value of e; and FALSE, if S is a set and all of its elements are not equal to the value of e. Warning: If you are using the special form x' \in S, this operator may assign a value to x' as a side effect. See Control Flow and Non-determinism . Determinism: Deterministic, unless you are using the special form x' \in S to assign a value to x', see Control Flow and Non-determinism . Errors: Pure TLA+ does not restrict the operator arguments. TLC flags a model checking error, when it discovers that e cannot be compared to the elements of S. Apalache produces a static type error, if the type of e is incompatible with the type of elements of S, or if S is not a set. Example in TLA+: 1 \in { 1, 2, 3 } \* TRUE 10 \in { 1, 2, 3 } \* FALSE {} \in { {1}, {2} } \* FALSE 1 \in { "a", "b" } \* model checking error in TLC, \* static type error in Apalache Example in Python: Python conveniently offers us in: >>> 1 in {1, 2, 3}
True
>>> 10 in {1, 2, 3}
False
>>> 1 in {"a", "b"}
False

