Notation: S \subseteq T LaTeX notation: subseteq Arguments: Two arguments. If both arguments are not sets, the result is undefined. Apalache type: (Set(a), Set(a)) => Bool, for some type a. Effect: This operator evaluates to: TRUE, if S and T are sets, and every element of S is a member of T; FALSE, if S and T are sets, and there is an element of S that is not a member of T. Determinism: Deterministic. Errors: Pure TLA+ does not restrict the operator arguments. TLC flags a model checking error, when it discovers that elements of S cannot be compared to the elements of T. Apalache produces a static type error, if S and T are either not sets, or sets of incompatible types. Example in TLA+: { 1, 2 } \subseteq { 1, 2, 3 } \* TRUE { 1, 2, 3 } \subseteq { 1, 2, 3 } \* TRUE { 1, 2, 3 } \subseteq { 1, 2 } \* FALSE { {1} } \subseteq { 1, 2, 3 } \* FALSE, model checking error in TLC \* static type error in Apalache Example in Python: Python conveniently offers us <=: >>> {1, 2} <= {1, 2, 3}
True
>>> {1, 2, 3} <= {1, 2, 3}
True
>>> {1, 2, 3} <= {1, 2}
False
