Notation: { e: x \in S } or { e: x \in S, y \in T }, or more arguments LaTeX notation: map Arguments: At least three arguments: a mapping expression, a variable name (or a tuple of names, see Advanced syntax ), a set. Additional arguments are variables' names and sets, interleaved. Apalache type: The formal type of this operator is a bit complex. Hence, we give an informal description for the one-argument case: x has the type a, for some type a, S has the type Set(a), e has the type b, for some type b, the expression { e: x \in S } has the type Set(b). Effect: We give the semantics for two arguments. We write it as a sequence of steps to ease understanding. This operator constructs a new set M as follows. For every element e_1 of S and every element e_2 of T: Bind the element e_1 to variable x, Bind the element e_2 to variable y, Compute the value of e under the binding [x |-> e_1, y |-> e_2], Insert the value e into the set M. Determinism: Deterministic. Errors: Pure TLA+ does not restrict the operator arguments. TLC flags a model checking error, if S is infinite. Apalache produces a static type error, if the type of elements of S is not compatible in the context of e when an element of S is bound to x. Advanced syntax: Instead of a single variable x, one can use the tuple syntax to unpack variables from a Cartesian product, see Tuples . For instance, one can write { x + y: <<x, y>> \in S }. In this case, for every element e of S, the variable x is bound to e[1] and y is bound to e[2]. The map expression constructs the set of expressions that are computed under this binding. Example in TLA+: { 2 * x: x \in { 1, 2, 3, 4 } } \* { 2, 4, 6, 8 } { x + y: x \in 1..2, y \in 1..2 } \* { 2, 3, 4 } \* check the section on tuples to understand the following syntax { x + y: <<x, y>> \in (1..2) \X (1..2) } \* { 2, 3, 4 } Example in Python: Python conveniently offers us the set comprehension syntax: >>> S = frozenset({1, 2, 3, 4})
>>> {2 * x for x in S}
{8, 2, 4, 6}
>>> T = {1, 2}
>>> {x + y for x in T for y in T}
{2, 3, 4}
>>> T2 = {(x, y) for x in T for y in T}
>>> T2
{(1, 1), (1, 2), (2, 1), (2, 2)}
>>> {x + y for (x, y) in T2}
{2, 3, 4}

