To see the complete code, check LamportMutexTyped.tla . We have added seven type annotations for 184 lines of code. Not bad. It was relatively easy to figure out the types of constants and variables in our example, though it required some exploration of the specification. As a rule, you always have to annotate constants and variables with types . Hence, we did not have to run the type checker seven times to see the error messages. The type annotations are useful on its own, since we do not have to traverse the spec to figure out the types of constants and states. Our more engineering-oriented peers find these annotations to be quite important. Sometimes, the type checker cannot find a unique type of an expression. This usually happens when you declare an operator of a parameter that can be: a function, a tuple, a record, or a sequence (or a subset of these four types that has at least two elements). For instance, here is a definition from GameOfLifeTyped.tla : Pos == { <<x, y>>: x, y \in 1..N } Although it is absolutely clear that x and y have the type Int, the type of <<x, y>> is ambiguous. This expression can either be a tuple <<Int, Int>>, or a sequence Seq(Int). In this case, we have to help the type checker by annotating the operator definition: \* @type: () => Set(<<Int, Int>>);
Pos == {<<x, y>>: x, y \in 1..N} Since it is common to have operators that take no arguments, Snowcat supports the following syntax sugar for operators without arguments: \* @type: Set(<<Int, Int>>);
Pos == {<<x, y>>: x, y \in 1..N}

