Notation: UNION S LaTeX notation: UNION S Warning: Do not confuse UNION S with S \union T. These are two different operators, which unfortunately have similar-looking names. Arguments: One argument. If it is not a set of sets, the result is undefined. Apalache type: Set(Set(a)) => Set(a), for some type a. Effect: Given that S is a set of sets, this operator computes the set T that contains all elements of elements of S: If X \in S, then X \subseteq T. If y \in T, then there is a set Y \in S that contains y, that is, y \in Y. In particular, UNION flattens the powerset that is produced by SUBSET. That is, (UNION (SUBSET S)) = S. Determinism: Deterministic. Errors: Pure TLA+ does not restrict the operator argument. TLC flags a model checking error, when it discovers that S is not a set of sets. Apalache produces a static type error, if the type of S is different from a set of sets. Example in TLA+: UNION { {0, 1}, {1, 2}, {3} } \* { 0, 1, 2, 3 } Example in Python: In contrast to SUBSET S, an implementation of UNION S in Python is quite simple: >>> from functools import reduce
>>> s = { frozenset({0, 1}), frozenset({1, 2}), frozenset({3}) }
>>> reduce((lambda x, y: x | y), s, set())
{0, 1, 2, 3}

