Notation: [ x \in S |-> e ] or [ x \in S, y \in T |-> e ], or more arguments LaTeX notation: fun-ctor Arguments: At least three arguments: a variable name (or a tuple of names, see Advanced syntax ), a set, and a mapping expression. Instead of one variable and one set, you can use multiple variables and multiple sets. Apalache type: The formal type of this operator is a bit complex. Hence, we give an informal description: x has the type a, for some type a, S has the type Set(a), e has the type b, for some type b, the expression [ x \in S |-> e ] has the type a -> b. Effect: We give the semantics for one argument. We write a sequence of steps to ease the understanding. This operator constructs a function f over the domain S as follows. For every element elem of S, do the following: Bind the element elem to variable x, Compute the value of e under the binding [x |-> elem] and store it in a temporary variable called result. Set f[elem] to result. Of course, the semantics of the function constructor in Specifying Systems does not require us to compute the function at all. We believe that our description helps you to see that there is a way to compute this data structure, though in a very straightforward and inefficient way. If the function constructor introduces multiple variables, then the constructed function maps a tuple to a value. See Example . Determinism: Deterministic. Errors: Pure TLA+ does not restrict the function domain and the mapping expression. They can be any combination of TLA+ values: Booleans, integers, strings, sets, functions, etc. TLC accepts function domains of comparable values. For instance, two integers are comparable, but an integer and a set are not comparable. See Section 14.7.2 of Specifying Systems . Apalache goes further: It requires the function domain to be well-typed (as a set), and it requires the mapping expression e to be well-typed. If this is not the case, the type checker flags an error. Advanced syntax: Instead of a single variable x, one can use the tuple syntax to unpack variables from a Cartesian product, see Tuples . For instance, one can write [ <<x, y>> \in S |-> x + y ]. In this case, for every element e of S, the variable x is bound to e[1] and y is bound to e[2]. The function constructor maps the tuples from S to the values that are computed under such a binding. Example in TLA+: [ x \in 1..3 |-> 2 * x ] \* a function that maps 1, 2, 3 to 2, 4, 6 [ x, y \in 1..3 |-> x * y ] \* a function that maps <<1, 1>>, <<1, 2>>, <<1, 3>>, ..., <<2, 3>>, <<3, 3>> \* to 1, 2, 3, ..., 6, 9 [ <<x, y>> \in (1..3) \X (4..6) |-> x + y ] \* a function that maps <<1, 4>>, <<1, 5>>, <<1, 6>>, ..., <<2, 6>>, <<3, 6>> \* to 5, 6, 7, ..., 8, 9 [ n \in 1..3 |-> [ i \in 1..n |-> n + i ]] \* a function that maps a number n from 1 to 3 \* to a function from 1..n to n + i. Like an array of arrays. Example in Python: In the following code, we write range(m, n) instead of frozenset(range(m, n)) to simplify the presentation and produce idiomatic Python code. In the general case, we have to iterate over a set, as the type and structure of the function domain is not known in advance. >>> # TLA: [ x \in 1..3 |-> 2 * x ]
>>> {x: 2 * x for x in range(1, 4)}
{1: 2, 2: 4, 3: 6}
>>> # TLA: [ x, y \in 1..3 |-> x * y ]
>>> {(x, y): x * y for x in range(1, 4) for y in range(1, 4)}
{(1, 1): 1, (1, 2): 2, (1, 3): 3, (2, 1): 2, (2, 2): 4, (2, 3): 6, (3, 1): 3, (3, 2): 6, (3, 3): 9}
>>> # TLA: [ <<x, y>> \in (1..3) \X (4..6) |-> x + y ]
>>> xy = {(x, y) for x in range(1, 4) for y in range(4, 7)}
>>> {(x, y): x + y for (x, y) in xy}
{(2, 4): 6, (3, 4): 7, (1, 5): 6, (1, 4): 5, (2, 6): 8, (3, 6): 9, (1, 6): 7, (2, 5): 7, (3, 5): 8}
>>> # TLA: [ n \in 1..3 |->
>>> # [ i \in 1..n |-> n + i ]]
>>> {
... n: {i: n + i for i in range(1, n + 1)}
... for n in range(1, 4)
... }
{1: {1: 2}, 2: {1: 3, 2: 4}, 3: {1: 4, 2: 5, 3: 6}}

