Notation: [f EXCEPT ![a_1] = e_1, ..., ![a_n] = e_n] LaTeX notation: [f EXCEPT ![a_1] = e_1, ..., ![a_n] = e_n] Arguments: At least three arguments. The first one should be a function, the other arguments are interleaved pairs of argument expressions and value expressions. Apalache type: In the case of a single-point update, the type is simple: (a -> b, a, b) => (a -> b), for some types a and b. In the general case, the type is: (a -> b, a, b, ..., a, b) => (a -> b). Effect: This operator evaluates to a new function g that is constructed as follows: Set the domain of g to DOMAIN f. For every element b \in DOMAIN f, do: If b = a_i for some i \in 1..n, then set g[b] to e_i. If b \notin { a_1, ..., a_n }, then set g[b] to f[b]. Importantly, g is a new function: the function f is not modified! Determinism: Deterministic. Errors: When a_i \notin DOMAIN f for some i \in 1..n, TLC flags a model checking error. When a_1, ..., a_n are not type-compatible with the type of DOMAIN f, Apalache flags a type error. When a_i \notin DOMAIN f, Apalache ignores this argument. This is consistent with the semantics of TLA+ in Specifying Systems . Advanced syntax: There are three extensions to the basic syntax. Extension 1 . If the domain elements of a function f are tuples, then, similar to function application, the expressions a_1, ..., a_n can be written without the tuple braces <<...>>. For example: [ f EXCEPT ![1, 2] = e ] In the above example, the element f[<<1, 2>>] is replaced with e. As you can see, this is just syntax sugar. Extension 2 . The operator EXCEPT introduces an implicit alias @ that refers to the element f[a_i] that is going to be replaced: [ f EXCEPT ![1] = @ + 1, ![2] = @ + 3 ] In the above example, the element f[1] is replaced with f[1] + 1, whereas the element f[2] is replaced with f[2] + 3. This is also syntax sugar. Extension 3 . The advanced syntax of EXCEPT allows for chained replacements. For example: [ f EXCEPT ![a_1][a_2]...[a_n] = e ] This is syntax sugar for: [ f EXCEPT ![a_1] = [ @ EXCEPT ![a_2] = ... [ @ EXCEPT ![a_n] = e ]]] Example in TLA+: LET f1 == [ p \in 1..3 |-> "working" ] IN [ f1 EXCEPT ![2] = "aborted" ] \* a new function that maps: 1 to "working", 2 to "aborted", 3 to "working" LET f2 == [x \in 1..3, y \in 1..3 |-> x * y] IN [ f2 EXCEPT ![1, 1] = 0 ] \* a new function that maps: \* <<1, 1>> to 0, and <<x, y>> to x * y when `x /= 0` or `y /= 0` LET f3 == [ n \in 1..3 |-> [ i \in 1..n |-> n + i ]] IN [ f3 EXCEPT ![2][2] = 100 ] \* a new function that maps: \* 1 to the function that maps: 1 to 2 \* 2 to the function that maps: 1 to 3, 2 to 100 \* 3 to the function that maps: 1 to 4, 2 to 5, 3 to 6 Example in Python: In the following code, we write range(m, n) instead of frozenset(range(m, n)) to simplify the presentation and produce idiomatic Python code. In the general case, we have to iterate over a set, as the type and structure of the function domain is not known in advance. Additionally, given a Python dictionary f, we write f.items() to quickly iterate over the pairs of keys and values. Had we wanted to follow the TLA+ semantics more precisely, we would have to enumerate over the keys in the function domain and apply the function to each key, in order to obtain the value that is associated with the key. This code would be less efficient than the idiomatic Python code. >>> # TLA: LET f1 == [ p \in 1..3 |-> "working" ] IN
>>> f1 = {i: "working" for i in range(1, 4)}
>>> f1
{1: 'working', 2: 'working', 3: 'working'}
>>> # TLA: [ f1 EXCEPT ![2] = "aborted" ]
>>> g1 = {i: status if i != 2 else "aborted" for i, status in f1.items()}
>>> g1
{1: 'working', 2: 'aborted', 3: 'working'} >>> # TLA: LET f2 == [x, y \in 1..3 |-> x * y] IN
>>> f2 = {(x, y): x * y for x in range(1, 4) for y in range(1, 4)}
>>> # TLA: [ f2 EXCEPT ![1, 1] = 0
>>> g2 = {k: v if k != (1, 1) else 0 for k, v in f2.items()}
>>> g2
{(1, 1): 0, (1, 2): 2, (1, 3): 3, (2, 1): 2, (2, 2): 4, (2, 3): 6, (3, 1): 3, (3, 2): 6, (3, 3): 9} >>> # TLA: [ n \in 1..3 |-> [ i \in 1..n |-> n + i ]]
>>> f3 = {n: {i: n + i for i in range(1, n + 1)} for n in range(4)}
>>> # TLA: [ f3 EXCEPT ![2][2] = 100 ]
>>> g3 = f3.copy()
>>> g3[2][2] = 100
>>> g3
{0: {}, 1: {1: 2}, 2: {1: 3, 2: 100}, 3: {1: 4, 2: 5, 3: 6}}

