This section outlines a proposed migration strategy, to replace such sets in older specifications. The convention presented in this section works with both the current version of Apalache, as well as the next iteration of the type-checker, currently in development. Suppose we use messages with types t1,...,tn in the specification and a message set variable msgs, like in the snippet below: VARIABLE \* @type: Set( [ type: Str, x1: a1, ..., xn: an, ... ] ); msgs ... \* Assuming S1: Set(a1), ..., Sn: Set(an) \* @type: Set( [ type: Str, x1: a1, ..., xn: an, ... ] );
Message == [type : {"t1"}, x1: S1, ...] \union ... \union [type : {"tn"}, xn: Sn, ...]
... TypeOk: msgs \subseteq Message We propose the following substitution: Instead of modeling the union of all messages as a single set, we model their disjoint union explicitly, with a record, in the following way: \* @type: [ int: Set([x: Int]), str: Set([y: Str]) ];
Messages == [ t1: [x1: S1, ...], ..., tn: [xn: Sn, ...] ] This way, Messages.t1 represents the set of all messages m, for which m.type would have been equal to "t1" in the original implementation, that is, [type: {"t1"}, x1: S1, ...]. For example, assume the original specification included Messages == [type: {"t1"}, x: {1,2,3}] \union [type: {"t2"}, y:{"a","b","c"}] that is, defined two types of messages: "t1", with an integer-valued field "x" and "t2" with a string-valued field "y". The type of any m \in Messages would have been [type: Str, x: Int, y: Str] in the old approach. The rewritten version would be: Messages == [ t1: [x:{1,2,3}], t2: [y:{"a","b", "c"}] ] If we took m: [ t1: Set([x: Int]), t2: Set([y: Str]) ], m would be a record pointing to two disjoint sets of messages (of categories "t1" and "t2" respectively). Values in m.t1 would be records with the type [x: Int] and values in m.t2 would be records with the type [y: Str]. Note, however, that this approach also requires a change in the way messages are added to, or read from, the "set" of all messages (m is a record representing a set, but not a set itself, in the new approach). Previously, a message m would be added by writing: msgs' = msgs \union {m} regardless of whether m.type = "t1" or m.type = "t2". In the new approach, one must always specify which type of message is being added. However, the type no longer needs to be a property of the message itself, i.e. the type field is made redundant. To add a message m of the category ti one should write msgs' = [ msgs EXCEPT !.ti = msgs.ti \union {m} ] Similarly, reading/processing a message, which used to be done in the following way: \E m \in msgs: /\ m.type = "ti" /\ A(m) is replaced by \E m \in msgs.ti: A(m)

