New syntax for type aliases We introduce a special syntax for introducing type alises, which is defined by the following single-rule grammar: A ::= aliasName "=" T
// an identifer in camel case, starting with a lower-case letter
aliasName ::= [a-z]+(?:[A-Z][a-z]*)* Typically, a type alias is defined via an annotation such as: \* @typeAlias: setOfIntegers = Set(Int);
module_typedefs == TRUE To refer to a type alias, we extend the grammar T with one more option: T ::= // all rules as above | '$' aliasName Whenever the type checker meets a reference like $aliasName, it tries to substitute $aliasName with the type that was earlier defined with the type alias. If no such alias is found, the type checker emits a type error. Old syntax for type aliases This is the old syntax. We will drop its support in September, 2022. Similar to the old syntax, type aliases are defined via a one-grammar rule: A_old ::= typeConst "=" T In contrast to the new syntax, the rule A_old uses the same syntax for aliases as for type constants. This rule binds a type (produced by T) to a name (produced by typeConst). As you can see from the definition of typeConst, the name should be an identifier in the upper case. The type checker should use the bound type instead of the constant type. In retrospect, this syntax confused the users and introduced usability issues. For instance, when the users forgot to include a type alias, the type alias was interpreted as a type constant, and the type checker showed incomprehensible error messages.

