The goal of the serialization is for the JSON structure to mimic the internal representation as closely as possible, for ease of deserialization. Concretely, whenever a class declares a field fld: T, its serialization also contains a field named fld, containing the serialization of the field value. For example, if TlaConstDecl declares a name: String field, its JSON serialization will have a name field as well, containing the name string. If a class field has the type Traversable[T], for some T, the corresponding JSON entry is a list containing serializations of the individual arguments. For example, OperEx is variadic and declares args: TlaEx*, so its serialization has an args field containing a (possibly empty) list. As a running example, take the expression 1 + 1, represented with the correct type annotations as OperEx( oper = TlaArithOper.plus, args = Seq( ValEx( TlaInt( 1 ) )( typeTag = Typed( IntT1() ) ), ValEx( TlaInt( 1 ) )( typeTag = Typed( IntT1() ) ) ) )( typeTag = Typed( IntT1() ) ) Since both sub-expressions, the literals 1, are identical, their serializations are equal as well: { "kind": "ValEx", "type": "Int", "value": { "kind": "TlaInt", "value": 1 }
} Observe that we choose to serialize TlaValue as a JSON object, which is more verbose, but trivial to deserialize. It has the following shape { "kind": <KIND> , "value": <VALUE>
} The value field depends on the kind of TlaValue: For TlaStr: a JSON string For TlaBool: a JSON Boolean For TlaInt(bigIntValue): If bigIntValue.isValidInt: a JSON number Otherwise: { "bigInt": bigIntValue.toString() } For TlaDecimal(decValue): a JSON string decValue.toString The reason for the non-uniform treatment of integers is that Apalache encodes its TLA+ integers as BigInt, which means that it permits values for which .isValidInt does not hold. While it might seem more natural to encode the entire TlaValue as a JSON primitive, without the added object layer we would have a much tougher time deserializing. We would need a) a sensible encoding of BigInt values, which are not valid integers, and b) a way to distinguish both variants of BigInt, as well as decimals, when deserializing (since JSON is not typed). We could encode all values as strings, but they would be similarly indistinguishable when deserializing. Importantly, the type field of the ValEx expression is not guaranteed to contain a hint, as it could be Untyped Take jsonOf1 to be the serialization of ValEx( TlaInt( 1 ) )( typeTag = Typed( IntT1() ) ) shown above. The serialization of 1 + 1 is then equal to { "kind": "OperEx", "type": "Int", "oper": "PLUS", "args": [jsonOf1, jsonOf1]
} In general, for any given oper: TlaOper of OperEx, the value of the oper field in the serialization equals oper.name.

