Check the example TwoPhase.tla from the repository of TLA+ examples (you will also need TCommit.tla , which is imported by TwoPhase.tla). This example has 176 lines of code, so we do not inline it here. As you probably expected, the type checker complains about not knowing the types of constants and variables. As for constant RM, we opt for using an uninterpreted type that we call RM. That is: CONSTANT \* @type: Set(RM); RM \* The set of resource managers By looking at the spec, it is easy to guess the types of the variables rmState, tmState, and tmPrepared: VARIABLES \* @type: RM -> Str; rmState, \* $rmState[rm]$ is the state of resource manager RM. \* @type: Str; tmState, \* The state of the transaction manager. \* @type: Set(RM); tmPrepared, \* The set of RMs from which the TM has received $"Prepared"$ \* messages. The type of the variable msgs is less obvious. We can check the original (untyped) definitions of TPTypeOK and Message to get an idea about the type of msgs: Message == ({[type |-> t, rm |-> r]: t \in {"Prepared"}, r \in RM } \union {[type |-> t] : t \in {"Commit", "Abort"}}) TPTypeOK == ... /\ msgs \in SUBSET Message From these (untyped) definitions, you can see that msgs is a set that contains records of two types: { type: Str } and { type: Str, rm: RM }. This seems to be problematic, as we have to mix in two records types in a single set, which requires us to specify its only type. To this end, we have to use the Variants module , which is distributed with Apalache. For reference, check the Chapter on variants . First, we declare a type alias for the type of messages in a separate file called TwoPhaseTyped_typedefs.tla: ----------------------- MODULE TwoPhaseTyped_typedefs ----------------
(* @typeAlias: message = Commit(NIL) | Abort(NIL) | Prepared(RM); *)
TwoPhaseTyped_aliases == TRUE ====================================================================== Usually, we place type aliases in a separate file for when we have to use the same type alias in different specifications, e.g., the specification and its instance for model checking. With the type alias MESSAGE, we specify that a message is a variant type, that is, it can represent three kinds of different values: A value tagged with Commit. Since we do not require the variant to carry any value here, we simply declare that the value has the uninterpreted type NIL. This is simply a convention, we could use any type in this case. A value tagged with Abort. Similar to Commit, we are using the NIL type. A value tagged with Prepared. In this case, the value is of importance. We are using the value RM, that is, the (uninterpreted) type of a resource manager. Once we have specified the variant type, we introduce three constructors, one per variant option: \* @type: $message;
MkCommit == Variant("Commit", "0_OF_NIL") \* @type: $message;
MkAbort == Variant("Abort", "0_OF_NIL") \* @type: RM => $message;
MkPrepared(rm) == Variant("Prepared", rm) Since the values carried by the Commit and Abort messages are not important, we use the uninterpeted value "0_OF_NIL". This is merely a convention. We could use any value of type NIL. Importantly, the operators MkAbort, MkCommit, and MkPrepared all produce values of type MESSAGE, which makes it possible to add them to a single set of messages. Now it should be clear how to specify the type of the variable msgs: \* @type: Set($message); msgs We run the type checker once again: $ apalache-mc typecheck TwoPhaseTyped.tla
... > All expressions are typed
Type checker [OK] As you can see, variants require quite a bit of boilerplate. If you can simply introduce a set of records of the same type, this is usually a simpler solution. For instance, we could partition msgs into three subsets: the subset of Commit messages, the subset of Abort messages, and the subset of Prepared messages. See the discussion in Idiom 15 .

