Sometimes, it helps to document the meaning of type components. Consider the following example from Recipe 5 : \* @type: (Seq(Int), Int, Int) => Bool;
Attacks(queens,i,j) If you think that an explanation of the arguments would help, you can do that as follows: (* @type: ( // the column of an n-th queen, for n in the sequence domain Seq(Int), // the index (line number) of the first queen Int, // the index (line number) of the second queen Int ) => Bool;
*)
Attacks(queens,i,j) You don't have to do that, but if you feel that types can also help you in documenting your specification, you have this option.

