Source files for this step : BinSearch2.tla . Diffs : BinSearch2.tla.patch . We start with the simplest possible case that occurs in binarySearch. Namely, we consider the case where low > high, that is, binarySearch never enters the loop. Introduce variables . To do that, we have to finally introduce some variables. Obviously, we have to introduce variables low and high. This is how we do it: VARIABLES \* The low end of the search interval (inclusive). \* @type: Int; low, \* The high end of the search interval (inclusive). \* @type: Int; high, The variables low and high are called state variables . They define a state of our state machine. That is, they are never introduced and never removed. Remember, TLA+ is not tuned towards any particular computer architecture, and thus it does not even have the notion of an execution stack. You can think of low and high as being global variables. Yes, global variables are generally frowned upon in programming languages. However, when dealing with a specification, they are much easier to reason about than the execution stack. We will demonstrate how to introduce local definitions later in this tutorial. We introduce two additional variables, the purpose of which might be less obvious: \* Did the algorithm terminate. \* @type: Bool; isTerminated, \* The result when terminated. \* @type: Int; returnValue The variable isTerminated indicates whether our search has terminated. Why do we even have to introduce it? Because, some computer systems are not designed with termination in mind. For instance, such distributed systems as the Internet and Bitcoin are designed to periodically serve incoming requests instead of producing a single output for a single input. If we want to specify the Internet or Bitcoin, do we understand what it means for them to terminate? The variable returnValue will contain the result of the binary search, when the search terminates. Recall, there is no execution stack. Hence, we introduce the variable returnValue right away. The downside is that we have to do bookkeeping for this variable. Initialize variables. Having introduced the variables, we have to initialize them. That is, we want to specify lines 2–3 of the Java code: 1: public static int binarySearch(int[] a, int key) {
2: int low = 0;
3: int high = a.length - 1; ...
17: } To this end, we change the body of the predicate Init to the following: Init == low = 0 /\ high = Len(INPUT_SEQ) - 1 /\ isTerminated = FALSE /\ returnValue = 0 You probably have guessed, what the above line means. Maybe you are a bit puzzled about the mountain-like operator /\. It is called conjunction , which is usually written as && or and in programming languages. The important effect of the above expression is that every variable in the left-hand side of = is required to have the value specified in the right-hand side of = [1] . As it is hard to fit many expressions in one line, TLA+ offers special syntax for writing a big conjunction. Here is the standard way of writing Init (indentation is important): \* Initialization step (lines 2-3)
Init == /\ low = 0 /\ high = Len(INPUT_SEQ) - 1 /\ isTerminated = FALSE /\ returnValue = 0 The above lines do not deserve a lot of explanation. As you have probably guessed, Len(INPUT_SEQ) computes the length of the input sequence. It is important to know that TLA+ does not impose any particular order of evaluation for /\. However, both Apalache and TLC evaluate some expressions of the form x = e in the initialization predicate as assignments. Hence, it is often a good idea to think about /\ as being evaluated from left to right. Update variables. Having done all the preparatory work, we are now ready to specify the behavior in lines 5 and 16 of binarySearch. 1: public static int binarySearch(int[] a, int key) {
2: int low = 0;
3: int high = a.length - 1;
4:
5: while (low <= high) { ...
15: }
16: return -(low + 1); // key not found.
17: } To this end, we redefine Next as follows: \* Computation step (lines 5-16)
Next == IF ~isTerminated THEN IF low <= high THEN \* lines 6-14: not implemented yet UNCHANGED <<low, high, isTerminated, returnValue>> ELSE \* line 16 /\ isTerminated' = TRUE /\ returnValue' = -(low + 1) /\ UNCHANGED <<low, high>> Most likely, you have no problem reading this definition, except for the part that includes isTerminated', returnValue', and UNCHANGED. Recall that a transition predicate, like Next, specifies the relation between two states of the state machine; the current state, the variables of which are referenced by unprimed names, and the successor-state, the variables of which are referenced by primed names. The expression isTerminated' = TRUE means that only states where isTerminated equals TRUE can be successors of the current state. In general, isTerminated' could also depend on the value of isTerminated, but here, it does not. Likewise, returnValue' = -(low + 1) means that returnValue has the value -(low + 1) in the next state. The expression UNCHANGED <<low, high>> is a convenient shortcut for writing low' = low /\ high' = high. Readers unfamiliar with specification languages might question the purpose of UNCHANGED, since in most programming languages variables only change when they are explicitly changed. However, a transition predicate, like Next, establishes a relation between pairs of states. If we were to omit UNCHANGED, this would mean that we consider states in which low and high have completely arbitrary values as valid successors. This is clearly not how Java code should behave. To encode Java semantics, we must therefore explicitly state that low and high do not change in this step. It is important to understand that an expression like returnValue' = -(low + 1) does not immediately update the variable on the left-hand side. Hence, returnValue still refers to the value in the state before evaluation of Next, whereas returnValue' refers to the value in the state that is computed after evaluation of Next. You can think of the effect of x' = e being delayed until the whole predicate Next is evaluated.
